export const selectMealItem = (mealItem) => {
  return{
    type: "MEAL_ITEM_SELECTED",
    payload: mealItem
  };
}

export const selectMealItems = (mealItems) => {
  return{
    type: "MEAL_ITEMS_SELECTED",
    payload: mealItems
  };
}
